import React, { Component } from 'react';
import './Nav.css';

const links = ["Home",
  "List",
  "Area",
  "Citations"];
const bar = links.map((link) =>
  <li>{link}</li>
);

class Nav extends Component {
  render() {
    return (
      <div className="App">
        <header className="App-header">
          <nav class = "main">
        		<ul class = "bar">
          		<li class = "link"><a href = " " class = "link">Home</a></li>
              <li class = "link"><a href = "">List of Illnesses</a></li>
              <li class = "link"><a href = "">Area</a></li>
              <li class = "link"><a href = "">Citations</a></li>
            </ul>
          </nav>
        </header>
      </div>
    );
  }
}

export default Nav;
